import React from 'react';
import "./index.css"
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";



const Kacla = () => {
    return (

        <>
            <div class='text-center mt-5 full-width cover-full width w-500 h-1000'>
           

                    <img src="/images/Ka_CLA.png" alt="" />

                    <button type="button" class="btn btn-primary btn-lg btn-center mt-10">Accel Link</button>&nbsp;

                    <button type="button" class="btn btn-primary btn-lg">CLA Link</button>
         

            </div>

        </>

    );
}


export default Kacla;
